import './detailsPage.css';

function DetailsPage() {
  return (
    <div className="App">
        <h1>MioMio</h1>
        <button >Carrito</button>
        <div className='divisor'></div>
        <button className='btn_volver'>Volver</button>   
        <div className='tarjeta tarjetaUno'></div>
        <div >
            <h2>Lorem Ipsum</h2>
            <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Error, ex fugiat, eligendi eos rem ratione inventore ducimus illo, vitae labore voluptate accusamus. Harum illo reiciendis hic dolores placeat vitae natus.</p>
        </div>
        <div className="detalle">
            <span>Colores: Rojo, Negro, Blanco</span>
            <div>Talles: D - M - L</div>
            <h3>Precio: $1500</h3>
        </div>
        <button className='btn_loQuiero'>LO QUIERO</button>
    </div>
  );
}

export default DetailsPage;
